import React, { useEffect, useState } from 'react';

function parseMapString(mapString) {
  // Remove surrounding braces if they exist
  const cleanedString = mapString.trim().replace(/^\{|\}$/g, '');

  const regex = /(\w+)=((?:[^=,]|=(?!\w+=))+)/g;
  const obj = {};
  let match;

  while ((match = regex.exec(cleanedString)) !== null) {
    const key = match[1];
    const value = match[2].trim();
    obj[key] = value;
  }

  return obj;
}

function App() {
  const [texts, setTexts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch('http://localhost:3000/texts')
      .then(res => res.json())
      .then(data => {
        setTexts(data);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <h1>Scanned Texts</h1>
      {loading && <p>Loading...</p>}
      {!loading && texts.length === 0 && <p>No texts stored yet.</p>}
      <ul>
        {texts.map(({ id, content, created_at }) => {
          const data = parseMapString(content);
          return (
            <li key={id} style={{ marginBottom: 20, borderBottom: '1px solid #ccc', paddingBottom: 10 }}>
              <div>
                <p><strong>Nombre:</strong> {data.nombre || 'N/A'}</p>
                <p><strong>Domicilio:</strong> {data.domicilio || 'N/A'}</p>
                <p><strong>Clave Elector:</strong> {data.clave_elector || 'N/A'}</p>
                <p><strong>CURP:</strong> {data.curp || 'N/A'}</p>
                <p><strong>Fecha de Nacimiento:</strong> {data.fecha_nacimiento || 'N/A'}</p>
                <p><strong>Sección:</strong> {data.seccion || 'N/A'}</p>
                <p><strong>Año de Registro:</strong> {data.ano_registro || 'N/A'}</p>
                <p><strong>Vigencia:</strong> {data.vigencia || 'N/A'}</p>
              </div>
              <small style={{ color: '#777' }}>{new Date(created_at).toLocaleString()}</small>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default App;
